package org.easy.easysocket;

import java.io.Serializable;

public class Person implements Serializable {
	private String name;
	private int age;
	private String s;
	private String s1;

	public Person() {
	}

	public Person(String name, int age) {
//        this.name = name;
//        this.age = age;

		this.name = name + "";
		this.age = age;
        this.s = new String(this.name);
        this.s1 = new String(this.name);
	}

	@Override
	public String toString() {
		return "Person{" +
				"name='" + name + '\'' +
				", age=" + age +
				", s='" + s + '\'' +
				", s1='" + s1 + '\'' +
				'}';
	}
}
